import React from 'react'
import Keyword from './Keyword'

export default function Keywords (props) {
  return (
    <div className='w3-container'>
      <ul className='w3-ul'>
        {props.keywords.map(k => {
          return <Keyword keyword={k} />
        })}
      </ul>
    </div>
  )
}
